package org.interviewquestions;

public class PrintStars {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int c,d,n=4;
		for( c=1;c<=n;c++)
		{
			
			for(d=1;d<=n;d++)
			{
				System.out.print(" "+"*");
			}
		System.out.println(" ");
		}

	}

}
